import React from 'react'

const AboutCard2 = () => {
    return (
        <>
            <div className="card card-1">
                <i className="icons fal fa-home-lg-alt"></i>
                <h3 className="card-title">Home Plants</h3>
                <h4 className="card-message">{{message}}</h4>

            </div>
        </>
    )
}

export default AboutCard2
